import React from "react";
/** @jsx jsx */
import { css, jsx } from "@emotion/core";

type AttendanceCardProps = {
  headerText: string;
  bodyText: number | string;
  subBodyText?: string;
};

const AttendanceCard = ({
  headerText,
  bodyText,
  subBodyText
}: AttendanceCardProps) => {
  const react = React;
  return (
    <div
      css={css`
         {
          background-color: #bcbec0;
          margin: auto
          width: 50%
          marginBottom: 20px
        }
      `}
    >
      <h4
        css={css`
           {
            background-color: #d3d3d3;
            padding: 20px;
          }
        `}
      >
        {headerText}
      </h4>
      <div
        css={css`
           {
            padding: 20px;
          }
        `}
      >
        <h5>{bodyText}</h5>
        {subBodyText && <div>{subBodyText}</div>}
      </div>
    </div>
  );
};

export default AttendanceCard;
